import React, { Suspense } from 'react'
import './style.css'
import imageLoading from './pokeball.svg'
const pokemonsData = React.lazy(() => import('./pokemons.json'))
export default function PokemonCard(props)
{

    return(
        <div className="card">
            <p>No {props.id}</p>
            <h1>{props.name}</h1>
            <Suspense fallback={<img src={imageLoading}></img>}>
                <img src={props.img}></img>
            </Suspense>
            <p>{props.type}</p>
        </div>
    );
}
